interface FoodOption {
  image: string;
  title: string;
  price: string;
  showButton: boolean;
}

interface Props {
  isOpen: boolean;
  onClose: () => void;
  children: React.ReactNode;
  foodOptions: FoodOption[];
}

const Carrinho: React.FC<Props> = ({ foodOptions }) => {
  return (
    <div>
      {foodOptions.map((foodOption, index) => (
        <div key={index}>
          <img src={foodOption.image} alt={foodOption.title} />
          <h3>{foodOption.title}</h3>
          <p>{foodOption.price}</p>
        </div>
      ))}
    </div>
  );
};

export default Carrinho;
